import logo from './logo.svg';
import './App.css';
import Sidebar from "./components/Sidebar";
import { Route, Switch} from 'react-router-dom';

function App() {
  return (
      <>
          <Router>
              <div className="App">
                  <Sidebar />
              </div>
              <Switch>
                  <Route path={"/"} />
              </Switch>
          </Router>
      </>
  );
}

export default App;
